import React, {useState, useEffect} from 'react';
import styled, { keyframes } from 'styled-components'
import {Carousel} from 'react-carousel-minimal'

//transform: translateX(100%);

const PhotoReelHolder = styled.div`
    background-color: orange;
    width: 90vw;
    height: 70vh;
    padding: 20vh 5vw 10vh 5vw;
`
//justify-content: center;
// align-content: center;
// align-items: center;
//padding: 5vh 5vh 5vh 5vh;

const images = [
    {
        image: require('../Images/1.jpg').default,
        caption: "photo",
    },
    {
        image: require('../Images/3.jpg').default,
        caption: "photo",
    },
    {
        image: require('../Images/4.jpg').default,
        caption: "photo",
    },
    {
        image: require('../Images/5.jpg').default,
        caption: "photo",

    },
    {
        image: require('../Images/6.jpg').default,
        caption: "photo",
    },
]

function Image() {

    return(
        <PhotoReelHolder>
            <Carousel
                    data = {images}
                    height = "75vh"
                    width = "100vw"
            />
        </PhotoReelHolder>
    );
}

export default Image
